(449, 'J16030520', '2016-03-29', '3', '2016', 'Kluang', 'JBA2041', 'Makmal Komputer', 'Komputer Peribadi', 'SKB/MK/KG/2004/01-01', '2004', 'Masalah:\n-Tiada paparan pada monitor apabila dihidupkan.\n-Masa dan tarikh komputer perlu sentiasa dibetulkan semula setiap kali komputer dihidupkan.\n-Mouse tidak berfungsi\n\nTroubleshooting yang dijalankan:\n-Mengenalpasti kerosakan dengan menukarkan perkakasan-perkakasan yang rosak dengan perkakasan-perkakasan yang tidak rosak.\n-Monitor,Mouse, AVR dan Battery CMOS adalah perkakasan-perkakasan yang dikenalpasti telah rosak.', 'Monitor, Battery CMOS, Mouse, AVR', NULL, NULL, 0),
